import{_ as o,r as i,o as a,c,a as e,b as r,e as l,d as n}from"./app-75535683.js";const d={},s=n(`<h2 id="git的基本使用" tabindex="-1"><a class="header-anchor" href="#git的基本使用" aria-hidden="true">#</a> git的基本使用</h2><ol><li><p>将远程仓库克隆到本地 <code>git clone https://gitee.com/用户个性地址/HelloGitee.git</code></p></li><li><p>设置备注 <code> git config --global user.name &quot;你的名字或昵称&quot;</code><code>git config --global user.email &quot;你的邮箱&quot;</code></p></li><li><p>git add . #将当前目录所有文件添加到git暂存区 <code> git commit -m &quot;my first commit&quot; #提交并备注提交信息</code><code>git push origin master #将本地提交推送到远程仓库 git push origin master --force 强制提交</code></p></li><li><p>强制上传 <code> git push -u origin master -f</code></p></li></ol><h3 id="多人协作的工作模式" tabindex="-1"><a class="header-anchor" href="#多人协作的工作模式" aria-hidden="true">#</a> 多人协作的工作模式</h3><ol><li>首先，可以尝试用<code>git push origin &lt;branch-name&gt;</code>推送自己的修改；</li><li>如果推送失败，则因为远程分支比你的本地更新，需要先用<code>git pull</code>试图合并；</li><li>如果合并有冲突，则解决冲突，并在本地提交；</li><li>没有冲突或者解决掉冲突后，再用<code>git push origin &lt;branch-name&gt;</code>推送就能成功！</li><li>如果<code>git pull</code>提示<code>no tracking information</code>，则说明本地分支和远程分支的链接关系没有创建，用命令<code>git branch --set-upstream-to &lt;branch-name&gt; origin/&lt;branch-name&gt;</code>。</li></ol><h3 id="配置简略命令" tabindex="-1"><a class="header-anchor" href="#配置简略命令" aria-hidden="true">#</a> 配置简略命令</h3><p>例如 <code> git lg</code></p><div class="language-text line-numbers-mode" data-ext="text"><pre class="language-text"><code>git config --global alias.lg &quot;log --color --graph --pretty=format:&#39;%Cred%h%Creset -%C(yellow)%d%Creset %s %Cgreen(%cr) %C(bold blue)&lt;%an&gt;%Creset&#39; --abbrev-commit&quot;
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div></div></div>`,7),g={href:"https://liaoxuefeng.com/books/git/conclusion/git-cheat-sheet.pdf",target:"_blank",rel:"noopener noreferrer"};function h(u,m){const t=i("ExternalLinkIcon");return a(),c("div",null,[s,e("p",null,[e("a",g,[r("Git Cheat Sheet"),l(t)])])])}const f=o(d,[["render",h],["__file","gitBasic.html.vue"]]);export{f as default};
